import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Test</h1>
        <input placeholder='Cari Film Kesayangan' />
        <div className='movie-container'>
          <div className='movie-wrapper'>
            <div className='movie-title'>Movie Pertama</div>
            <img className='movie-image'></img>
            <div className='movie-date'>11-12-2022</div>
            <div className='movie-rate'>8.09</div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
